@erak There seem to be a bunch of seperate, and maybe unrelated boost issues.

If you follow the homebrew formula for Solidity 0.4.x, it installs Boost 1.6 and works, @hu55a1n1 is using their own version, which I think breaks the build.

But I have had other issues running tests on macOS builds (just installing dependencies with Homebrew), as the dependency script installs boost 1.7+. If you manually install 1.69 instead, then tests run fine.
